(18,	3,	1,	'deferredfeedback',	12,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Analistas de Compliance encargados de contactar a clientes cuya remesa o cotización cae en estado de revisión por compliance:: Rafael Fernandez y José Bustos; b y c; Jocelyn Estay, Daniel Hurtado y Gabriel Castro; a y c; Patricia Reyes y Carolina Basso',	'Patricia Reyes y Carolina Basso',	NULL,	1641829725),
(19,	3,	2,	'deferredfeedback',	8,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Customer Experience es un equipo reactivo a los problemas:: Falso; Verdadero',	'Falso',	NULL,	1641829736),
(20,	3,	3,	'deferredfeedback',	10,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'En el canal de cx-team-pub:: Se publica información respecto a los nuevos ingresos del equipo.; Se publican los resultados de las evaluaciones del cliente para los casos cerrados de Salesforce.; Se realizan comunicados generales y levantamientos de solicitudes a CX.; Se publican noticias relacionadas unicamente al equipo de CX ya que es privado.; Se levantan casos a compliance.',	'Se realizan comunicados generales y levantamientos de solicitudes a CX.',	NULL,	1641821918),
(21,	3,	4,	'deferredfeedback',	9,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Plataforma de back-office de Global66:: Admin; QuickSight; Iterable; Portal Global 66; Salesforce',	'Admin',	NULL,	1641821918),
(22,	3,	5,	'deferredfeedback',	14,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Se encarga de derivar a CX los casos de redes sociales a través de Salesforce:: Content Analyst - Adrián; Operation Analyst - Aracely; Security Analyst - Valentina; Community Manager - Diego; Community Manager - Irlanda',	'Community Manager - Diego',	NULL,	1641821918),
(23,	3,	6,	'deferredfeedback',	13,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Son quienes confirman el depósito realizado por parte de los clientes: a) Rotseny Contreras b) Karina Jorquera c)Katherine Berríos d) Mariangel Planchart e) Marcelo Lozano: a y b; b, c y e; a y d; b y d; b y e',	'b y e',	NULL,	1641821918),
(24,	3,	7,	'deferredfeedback',	11,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Son quienes envían las órdenes de pago a destino: a) Mariangel Planchart b) Katherine Berríos c) Marcelo Lozano d) Rotseny Contreras e) Karina Jorquera: b y d; b, c y d; b, c y e; a y d; a y b',	'a y d',	NULL,	1641821918),
(79,	10,	1,	'deferredfeedback',	40,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Al dar clic en el menú de ayuda, se abre una página de:: Admin, donde podemos ver el estado de nuestros envíos en la plataforma de Global66.; Soporte, en la cual podemos hablar por chat en vivo directamente con un asesor o analista.; Salesforce, que aloja al Centro de Ayuda, en la cual podremos revisar artículos de interés e ingresar un caso para CX.',	'Salesforce, que aloja al Centro de Ayuda, en la cual podremos revisar artículos de interés e ingresar un caso para CX.',	NULL,	1648770472),
(80,	10,	2,	'deferredfeedback',	34,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Antes de cotizar, ¿el cliente siempre debe realizar una carga?: Verdadero; Falso',	'Falso',	NULL,	1648770472),
(81,	10,	3,	'deferredfeedback',	32,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Creamos el destinatario deseado:: Ingresando manualmente los datos desde la opción \"Nuevo destinatario\".; a y b; Copiando el link desde la opción \"Tu destinatario ingresa sus datos\".',	'a y b',	NULL,	1648770472),
(82,	10,	4,	'deferredfeedback',	39,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'El cliente puede editar los siguientes datos en su perfil:: Datos de identificación; Datos de residenciales; Datos bancarios',	'Datos bancarios',	NULL,	1648770472),
(83,	10,	5,	'deferredfeedback',	37,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'El monto mínimo de carga y retiro es:: 5 USD Y 10 USD; 20 USD Y 10 USD; 10 USD Y 3 USD; 20 USD Y 1 USD; 3 USD Y 10 USD',	'3 USD Y 10 USD',	NULL,	1648770472),
(84,	10,	6,	'deferredfeedback',	33,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'En el caso de un envío rechazado y devuelto por datos incorrectos, el cliente puede editar los datos de su destinatario para reintentar un nuevo envío:: Verdadero; Falso',	'Verdadero',	NULL,	1648770472),
(85,	10,	7,	'deferredfeedback',	35,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'En México, el cliente puede realizar el pago de su remesa o envío a través de:: Transferencia bancaria; a y b; Depósito en efectivo',	'a y b',	NULL,	1648770472),
(86,	10,	8,	'deferredfeedback',	31,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'No es posible recuperar contraseña si la cuenta fue creada con Facebook o Google.: Verdadero; Falso',	'Falso',	NULL,	1648770472),
(87,	10,	9,	'deferredfeedback',	38,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Respecto al apartado Invita y Gana, el promotor puede ver que su invitación ha sido exitosa y ha obtenido el premio cuando:: Cuando el referido se registra con el link y su primer envío por menos de 1000 USD pasa a estado exitoso.; El referido se registra con el link y este último lo comparte con más amigos.; El referido se registra con el link y realiza su primer envío.',	'Cuando el referido se registra con el link y su primer envío por menos de 1000 USD pasa a estado exitoso.',	NULL,	1648770472),
(88,	10,	10,	'deferredfeedback',	36,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Un retiro se realiza a través de:: Depósito en efectivo, el cliente retirar el dinero.; Transferencia bancaria a la cuenta registrada en el perfil del cliente.',	'Transferencia bancaria a la cuenta registrada en el perfil del cliente.',	NULL,	1648770472),
(143,	17,	1,	'deferredfeedback',	15,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'¿Cuáles servicios ofrece Global66?: Transferencias nacionales e internacionales.; Transferencias internacionales, Pagos P2P y Wallet multimoneda.; Transferencias internacionales, Pagos P2P, Wallet multimoneda y tarjeta prepago.',	'Transferencias internacionales, Pagos P2P y Wallet multimoneda.',	NULL,	1648774064),
(144,	17,	2,	'deferredfeedback',	16,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'¿Cuáles son nuestras rutas de origen?: Colombia, Argentina, Chile, Perú, México, Brasil, Ecuador y USA.; México, Brasil, Ecuador, Perú, Colombia, Chile, Argentina, y España.; Chile, Perú, Colombia, Argentina, México, Brasil, Ecuador, Uruguay y España.',	'México, Brasil, Ecuador, Perú, Colombia, Chile, Argentina, y España.',	NULL,	1648774006),
(145,	17,	3,	'deferredfeedback',	18,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'¿Qué es una transferencia P2P?: Transferencias de dinero entre clientes empresa.; Transferencias nacionales entre personas.; Transferencias de dinero realizadas desde la app entre personas que poseen una cuenta Global66.',	'Transferencias de dinero realizadas desde la app entre personas que poseen una cuenta Global66.',	NULL,	1648774006),
(146,	17,	4,	'deferredfeedback',	20,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'El remitente debe solicitar los datos correctos del beneficiario antes de realizar la cotización:: Falso; Verdadero',	'Verdadero',	NULL,	1648774006),
(147,	17,	5,	'deferredfeedback',	17,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Global66 es una empresa tecnológica del rubro financiero:: Verdadero; Falso',	'Verdadero',	NULL,	1648774006),
(148,	17,	6,	'deferredfeedback',	23,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Nuestros clientes son de dos tipos:: Personas y organizaciones.; Empresas y microempresas.; B2C y B2B.',	'B2C y B2B.',	NULL,	1648774006),
(149,	17,	7,	'deferredfeedback',	21,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Orden de los estados de una cotización de cara al cliente:: En validación, Pago confirmado, En revisión, Transferencia Enviada, Transferencia exitosa.; En validación, Pago confirmado, Transferencia Enviada, Operación exitosa.; En validación, Pago confirmado, En camino, Operación exitosa.',	'En validación, Pago confirmado, En camino, Operación exitosa.',	NULL,	1648774006),
(150,	17,	8,	'deferredfeedback',	19,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Para que el destinatario reciba actualizaciones del estado del envío o cotización deberá tener una cuenta en Global66.: Verdadero; Falso',	'Falso',	NULL,	1648774006),
(151,	17,	9,	'deferredfeedback',	22,	1,	5.0000000,	0.0000000,	1.0000000,	0,	'Una operación puede quedar declinada por diferentes motivos: *: Transferencia de tercero, pago no encontrado, envío anulado.; Cotización vencida, pago de tercero, pago no encontrado, pago en efectivo.; Envío o remesa devuelta por datos incorrectos.',	'Cotización vencida, pago de tercero, pago no encontrado, pago en efectivo.',	NULL,	1648774006);
